import { useState, UseEffect } from "react";


function App() {
  return (
    <div className="App">
      <h1>Welcome!!</h1>
      <h4>Your Tasks</h4>

      <div className="todos">
        <div className="todo">
          <div className="checkbox"></div>
          <div className="text">Something</div>
          <div className="delete-todo"></div>
        </div>
        
        <div className="todo is-complete">
          <div className="checkbox"></div>
          <div className="text">Something</div>
          <div className="delete-todo"></div>
        </div>
      </div>


    </div>
  );
}

export default App;
